import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import "bootstrap/dist/css/bootstrap.min.css";
import { useState } from "react";
import Carousel from "react-bootstrap/Carousel";
import Casa from "../img/Casa.jpg";
import Telefoni from "../img/telefoni.jpg";
import Uomo from "../img/retemobile.jpg";

const HomePage = () => {
  const [index, setIndex] = useState(0);

  const handleSelect = (selectedIndex) => {
    setIndex(selectedIndex);
  };
  return (
    <>
      <Navbar expand="lg bg-warning">
        <Container className="ms-0">
          <Navbar.Brand href="#home" className=""></Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar">
            <Nav className="me-auto text-center">
              <Nav.Link href="#home" className="text-white">
                FlySim
              </Nav.Link>
              <Nav.Link href="#home" className="text-white">
                Dove siamo ?
              </Nav.Link>
              <Nav.Link href="#home" className="text-white">
                Chi siamo?
              </Nav.Link>

              <Nav.Link href="#home" className="text-white">
                Login
              </Nav.Link>
              <Nav.Link href="#home" className="text-white">
                Registrati
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Carousel activeIndex={index} onSelect={handleSelect} className="mt-5">
        <Carousel.Item>
          <img className="d-block w-100" src={Casa} alt="first-slide" style={{ height: "500px", objectFit: "cover" }} />
          <Carousel.Caption>
            <h3 className="">Rete Fissa</h3>
            <p>Tutta la velocità della fibra , ad un prezzo accessibile</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={Uomo} alt="second-slide" style={{ height: "500px", objectFit: "cover" }} className="d-block w-100" />
          <Carousel.Caption>
            <h3 className="text-warning">Rete Mobile</h3>
            <p>Lo sapevi il nostro servizio 5G è differente vieni a scoprirlo</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <img src={Telefoni} alt="second-slide" style={{ height: "500px", objectFit: "cover" }} className="d-block w-100" />
          <Carousel.Caption>
            <h3>Scegli il telefono che fa per te </h3>
            <p>IPHONE , SAMSUNG , XIAOMI e molti altri ancora scelti per te</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    </>
  );
};

export default HomePage;
